import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

const Footer = () => {
  const contentFooter = [
    "About food",
    "About food",
    "About food",
    "About food",
    "About food",
    "About food",
    "About food",
    "About food",
  ];

  return (
    <Box className="footer_Component">
      <Link href="/" underline="none">
        <img
          src="https://i.pinimg.com/originals/82/be/d4/82bed479344270067e3d2171379949b3.png"
          alt=""
          style={{ objectFit: "cover", maxHeight: "13vh", maxWidth: "13vh" }}
        />
      </Link>
      <Box>
        {contentFooter.map((e) => (
          <Typography
            gutterBottom
            variant="p"
            component="div"
            className="textNameFood"
          ></Typography>
        ))}
      </Box>
    </Box>
  );
};

export default Footer;
